import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import ListSubheader from '@material-ui/core/ListSubheader';

class PreviewList extends React.Component {
  constructor(props){
    super(props)
       this.state = {imported:props.SortedSongs, features:[], generateReady:false, totalTime:0, renderTable: true, pickPlaylist: false, open:false, setOpen: false, featuresGenerated:false,user_id:"null"}
  }

  render(){
  return (
    <List className={classes.root} subheader={<li />}>
        <li key={`${props.sectionId}`} className={classes.listSection}>
          <ul className={classes.ul}>
            <ListSubheader>{`Build Up Generated Playlist`}</ListSubheader>
            {list.map((item,index) => (
              <ListItem style={{color:'black'}}key={item.id+index}>
                <ListItemText primary={`${item.name} by ${item.artists[0].name}`} />
              </ListItem>
            ))}
          </ul>
        </li>
    </List>
  );
     }

}
